import axios from 'axios';


const token = localStorage.getItem('user')

export async function getReadingAPI() {
    try {
        const { data } = await axios({
          method: "GET",
          url: `${baseUrl}/book/list/false`,
          headers: {
            Authorization: token
          }
        });
        return data;
      } catch (e) {
        console.log(e);
      }
}
